import React from "react";
import { CSSTransition } from "react-transition-group";
import "./Home.styles.css";

function Home() {
  const [inProp, setInProp] = React.useState(false);

  React.useEffect(() => {
    setInProp(true);
  }, []);

  return (
    <div className="home main-content">
      <CSSTransition in={inProp} timeout={300} classNames="fade" unmountOnExit>
        <div className="hero-text">
          <h1>Hey, I'm Fernando!</h1>

          <p>
            I'm a Front-End Developer and UI/UX Designer who loves building
            fun websites, apps and other digital stuff. I just enjoy creating
            things, you know?
          </p>

          <p>
            Anyway, have a look around and get in touch if you'd like to work
            together!
          </p>
        </div>
      </CSSTransition>
    </div>
  );
}

export default Home;
